    render() {
       return(
        <>
        <div className="mt-4 pt-4">
                <div id="main" className="row mx-auto">
                <img alt="..." className="col-sm-6 p-0" src={this.props.src}/>
                </div>
                <div>
                    <h4>{this.props.brand}</h4>
                </div>
        </div>
        </>
    );
}
}
export default HomeSection;
